import React from "react";
import { Col, Row } from "react-bootstrap";

function AboutUs() {
  return (
    <>
      <Row>
        <Col md={4}>
          <div style={{ position: "relative", top: 0, left: 0 }}>
            <img
              src={require("../assets/pic01.jpg")}
              style={{
                position: "relative",
                top: 0,
                left: 0,
              }}
              alt="about us"
            />
            <img
              src={require("../assets/pic01.jpg")}
              style={{
                position: "absolute",
                top: "60px",
                left: "80px",
              }}
              alt="about us"
            />
          </div>
        </Col>
        <Col md={8}>
          <h1>About</h1>
        </Col>
      </Row>
    </>
  );
}

export default AboutUs;
